// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;
pragma abicoder v2;

// import not working on wondows "File import callback not supported" error
import "../node_modules/@chainlink/contracts/src/v0.7/interfaces/AggregatorV3Interface.sol";

contract CryptoLife {
    
    address private owner; // An owner's address
    
    // A marketing plan struture

    struct MP {
        uint registrationPrice;
        uint[] leaderBonusLevels;
    }

    // A partner structure
    struct Partner {
        uint id; // An ID of the partner
        address sponsorAddress; // A sponsor's address
        uint[][] level; // An array of a next slot numbers for each level of all marketing plans
        address[] referals; // An array of a direct referals
        uint registrationDate; // A registration date timestamp
        uint registrationBlockNumber; // A registration block number
    }

    // Coin price reciver
    AggregatorV3Interface internal priceFeed;

    // A list of partners
    mapping (address => Partner) private partners; 

    // An array of IDs for a short referal links
    address[] private shortIdForLinks;

    // An ID prefix  
    uint private prefID = 1; 

    // A list of a bounuses in persents
    uint[] private leaderBonusLevels; 

    // Number of slots to a next-level upgrade
    uint private slotsPerLevel;

     // Number of slots in a level's pool 
    uint private slotsPerPool;

    // A direct bonus or the slots
    uint private directBonus;

    // A list of marketing plans
    MP[] private marketingPlans; 

    // A summ to collect and pay out to a Top Leader
    uint private topLeaderBonusSumm;

    // A date and time when a current Top Leader bonus collection started
    uint private topLeaderStartDate;

    // A current Top Leader address
    address private topLeaderAddress;

    // A current Top Leader Result
    uint private topLeaderResult;

    // A minimum level required to become a Top Leader
    uint private topLeaderMinimumLevel;

    // A Top Leader colletction fee
    uint private topLeaderBonusFee;

    // A Top Leadr Bonus collected summ
    uint private topLeaderBonusCollectedSumm = 0;

    // A registration event
    event registration (
        uint indexed partnerID, 
        address indexed partnerAddress, 
        address indexed sponsorAddress,
        uint mp
    );
    
    // A level up event
    event levelUp (
        address indexed partnerAddress, 
        uint level,
        uint mp
    );
    
    // A bonus paid out event
    event bonusPaidOut (
        address indexed partnerAddress,
        uint indexed bonusType, 
        uint amount,
        uint level,
        uint mp
    );

    // A pool reopened  event
    event poolIsReopened (
        address indexed partnerAddress, 
        uint level,
        uint mp
    );
    
    // A missed bonus event
    event missingBounus (
        address indexed partnerAddress, 
        uint bonusType,
        uint level,
        uint amount,
        uint mp,
        uint bonusMp
    );

    event test (
        uint price,
        uint sendAmount);

    event test2 (
        uint notReceived,
        uint leftToPay
       );

   
    // The only registered partners allowed modifier
    modifier onlyRegistered {
        
        // Сhecking that the address is registered
        require( partners[msg.sender].level.length > 0, "The address is not registered.");
        
        _;

    }
    
    // The only owner allowed modifier
    modifier onlyOwner {
        
        // Check owner's address
        require(msg.sender == owner, "You have no promission to this operation");
        
        _;
    }

    
    constructor (){


        // Coin price resiver activation

        // BNB/USD testnet address 0x2514895c72f50D8bd4B4F9b1110F0D6bD2c97526
        // BNB/USD mainnet address 0x0567F2323251f0Aab15c8dFb1967E4e8A7D42aeE

        priceFeed = AggregatorV3Interface(0x2514895c72f50D8bd4B4F9b1110F0D6bD2c97526);
        
        // Initiation of a matrix rules
        
        owner = msg.sender; // The owner is a contract sender

        slotsPerPool = 3; // A pool on each level has three slots
        slotsPerLevel = 9; // Each level has three free pools with three slots each
        

        // initiate a marketing plans
        MP memory mp;
        marketingPlans.push(mp);
        marketingPlans.push(mp);
        marketingPlans.push(mp);
    
        // Set a Top Leader bounus fee in percents 
        topLeaderBonusFee = 5;

        // Set a bonus for selling a slots in percents 
        directBonus = 75;

        // Set network bounuses for the 3rd marketing plan in percents 
        
        // Set an additional bonus for purchases of partners of the 2nd level of depth
        marketingPlans[2].leaderBonusLevels.push(3); 
        
        // Set an additional bonus for purchases of partners of the 3rd level of depth
        marketingPlans[2].leaderBonusLevels.push(3);
        
        // Set a bonus for purchases of partners of the 4th level of depth
        marketingPlans[2].leaderBonusLevels.push(3); 
        
        // Set a bonus for purchases of partners of the 5th level of depth
        marketingPlans[2].leaderBonusLevels.push(2); 
        
        // Set a bonus for purchases of partners of the 6th level of depth
        marketingPlans[2].leaderBonusLevels.push(2); 

        // Set network bonuses for the 2nd marketing plan in percents 

        // Set a bonus for purchases of partners of the 2nd level of depth
        marketingPlans[1].leaderBonusLevels.push(5); 
        
        // Set a bonus for purchases of partners of the 3rd level of depth
        marketingPlans[1].leaderBonusLevels.push(2);

        // No network bonuses for the 1st marketing plan

        
        // Set fixed prices of marketing plans in USD

        // Registration price of the 1st marketing plan
        marketingPlans[0].registrationPrice = 10;

        // Registration price of the 2nd marketing plan
        marketingPlans[1].registrationPrice = 40;

        // Registration price  of the 3rd marketing plan
        marketingPlans[2].registrationPrice = 200;

        // Add short link to owner
        shortIdForLinks.push(owner);

        // Set the owner as a first partner
        Partner memory p; 
        partners[owner] = p;
        
         // Set the owner's ID
        partners[owner].id = prefID;

        // Set the owner's registration date 
        partners[owner].registrationDate = block.timestamp;

        // Set the owner's registration block number
        partners[owner].registrationBlockNumber = block.number;

        // Set the owner sponsored by himself
        partners[owner].sponsorAddress = owner;

        // Set the owner's levels of each marketing plan

        // Loop marketing plans
        for (uint8 i = 0; i < marketingPlans.length; i++){

            // Activating the owner's current marketing plan
            partners[owner].level.push([1]);
        }

        // Call the reistration event
        emit registration(partners[owner].id, owner, owner, 0);

        // Call the second marketing plan activation event
        emit registration(partners[owner].id, owner, owner, 1);

        // Call the third marketing plan activation event
        emit registration(partners[owner].id, owner, owner, 2);

        // Set the Top Leader bonus summ
        topLeaderBonusSumm = 0.1 ether;

        // Set the colection start date
        topLeaderStartDate = block.timestamp;

        // Set the current Top Leader
        topLeaderAddress = owner;

        // Set the current Top Leader result
        topLeaderResult = 0;

        // Set the minimum level requerement
        topLeaderMinimumLevel = 6;
    }
    
   
    // Level up the partner
    function partnerLevelUp(uint mp, uint level, uint80 roundID) payable public { 

        // Check a levels number to up         
        require(level > 0, "Level have to be above zero");

        // Check a marketing plan number
        require (mp >= 0 && mp < marketingPlans.length, "Wrong marketing plan number");

        // A next level number varable
        uint nextMPLevel = level ;

        // A required marketing plan activation check
        if (partners[msg.sender].level.length > mp){

            // The required marketing plan is active

            // Increase the next level by current marketing plan levels number
            nextMPLevel += partners[msg.sender].level[mp].length;

        }

        // Set array of a required level ups on each marketing plan to level up current
        uint[] memory requiredLevels = getRequiredLevels(msg.sender, mp, nextMPLevel);

        // Get the current exchange rate
        (
            uint exchangeRate,
            uint80 newRoundID,
            uint8 decimals // The number of decimals in the current exchange rate.
        )=getExchangeRate(roundID);
      
        // Set the level up price
        uint levelPrice = nextLevelPrice(requiredLevels, exchangeRate, decimals);
            
        // Check that the sent summ is enough
        require(msg.value >= levelPrice, "You sent not enough coins");

        // Level up the partner
        upPartnerLevels(msg.sender, requiredLevels, exchangeRate, decimals);

        // Check the operation balence
        if ( msg.value > levelPrice) {

            // The balance above the zero
                
            // Return the balace to the sender
            payable(msg.sender).transfer(msg.value - levelPrice);
        }   

        // Check if a Top Leader bonus summ reached
        if (topLeaderBonusCollectedSumm >= topLeaderBonusSumm) {

            // The Top Leader Bonus is coolected and ready to be paid

            // Pay the bonus to the Partner
            topLeaderBonusPay(); 
       
        }  
                
    }
        
    // A new partner registration
    function registerNewPartner (uint sponsorID, uint mp, uint80 roundID) payable public {

        // Сhecking that the address is not registered
        require (partners[msg.sender].id == 0, "This address is already registered"); 

        // Check a marketing plan number
        require(mp >= 0 && mp < marketingPlans.length, "Wrong marketing plan number");

        // Check a sponsor ID 
        require( sponsorID > 0 && sponsorID < type(uint).max, "Wrong sponsor ID");
       
        // Set the registration cost
        uint registrationCost = 0;

        // Get the current exchange rate
        (
            uint exchangeRate,
            uint80 newRoundID,
            uint8 decimals // The number of decimals in the current exchange rate.
        )=getExchangeRate(roundID);

        // Loop marketing plans
        for (uint8 i = 0; i<=mp; i++) {

            // Increase the reistration cost by a current marketing plan registration price 
            registrationCost += getRegistrationPrice(i, exchangeRate, decimals);  

        }
           
        // Check that the sent summ is enough
        require(msg.value >= registrationCost, "You sent not enough coins. Exchange rates may have changed since the last update.");        
        
        // The owner is a sponsor of all registrations without or with a wrong sponsors ID
        address sponsorAddress = owner; 

        // Correct sponsor ID 
        uint sponsorIDcorrected = sponsorID - prefID;
        
        // Check a corrected sponsor's ID
        if ( sponsorIDcorrected  > 0 && sponsorIDcorrected < shortIdForLinks.length) {
            
            // Recive an sponsor's address from the short links list
            sponsorAddress = shortIdForLinks[sponsorIDcorrected]; 
        }

        // New Partner creation 
        createNewPartner(msg.sender, sponsorAddress);

        // Check and udate a Top Leader status
        topLeaderCheck(sponsorAddress);

        // Set array of a required level ups on each marketing plan to level up 
        uint[] memory requiredLevels = getRequiredLevels(msg.sender, mp, 1);           
        
        // Level up the partner
        upPartnerLevels(msg.sender, requiredLevels, exchangeRate, decimals);      

        // A balance after registration
        uint balance = msg.value - registrationCost;

        // Check the operation balence
        if ( balance > 0) {
            
            // Return the balace to the sender
            payable(msg.sender).transfer(balance);
        }

        // Check if a Top Leader bonus summ reached
        if (topLeaderBonusCollectedSumm >= topLeaderBonusSumm) {

            // The Top Leader Bonus is coolected and ready to be paid

            // Pay the bonus to the Partner
            topLeaderBonusPay(); 
       
        }  
           
    }

    // Get the current exchange rate by round ID
    function getExchangeRate(uint80 roundID) public view returns(uint exchangeRate, uint80 newRoundID, uint8 decimals) {

        (
            uint80 lastRoundID, 
            int lastPrice,
            uint lastStartedAt,
            uint lastTimeStamp,
            uint80 lastAnsweredInRound
        ) = priceFeed.latestRoundData();

        exchangeRate = uint(lastPrice);
        newRoundID = lastRoundID;

        if (roundID != 0){

            (
                uint80 id, 
                int price,
                uint startedAt,
                uint timeStamp,
                uint80 answeredInRound
            ) = priceFeed.getRoundData(roundID);

            if (timeStamp > lastTimeStamp + 2*1 minutes) {

                exchangeRate = uint(price);
                newRoundID = roundID;                
            }
        }
        decimals = priceFeed.decimals();
    }   
    
    // Check for registration
    function isRegistered () 
        public 
        view 
        returns (bool) {
                
        // Returns true if ID is setted
        return partners[msg.sender].id>0;
    } 

    // Get the current registration prices by round ID
    function getRegistrationPrices (uint80 roundID) public view returns (uint[] memory registrationPrices, uint80 newRoundID){

        // Get the current exchange rate
        (
            uint exchangeRate, // The current exchange rate
            uint80 currentRoundID,  // A new round ID
            uint8 decimals // The number of decimals in the current exchange rate
        )=getExchangeRate(roundID); 

        // Set the new round ID
        newRoundID = currentRoundID;

        // Set the length of the registration prices array equal to the marketing plans number 
        registrationPrices = new uint[](marketingPlans.length);

        // Loop marketing plans
        for (uint8 i = 0; i <marketingPlans.length; i++){

            // Set current price
            registrationPrices[i] = getRegistrationPrice(i, exchangeRate, decimals);
        }
    }   
    
    // Get a list of the partners who were sponsored by the address of the partner
    function getReferals(address partnerAddress) 
        public 
        view 
        onlyRegistered 
        returns ( address[] memory) {
 
        // Return the partner's referals list  
        return partners[partnerAddress].referals;
    }

    // Count members in the partner's network
    function getNetworkCount(address partnerAddress)
        public
        view
        onlyRegistered
        returns(uint count) {
        
        // Count referals
        count = partners[partnerAddress].referals.length;

        // Loop referals
        for(uint8 i = 0; i < partners[partnerAddress].referals.length; i++)  {

            // Add referal's network count
            count += getNetworkCount(partners[partnerAddress].referals[i]);
        }      
    }

    // Get Next level prices
    function getNextLevelPrices(uint80 roundID) 
        public 
        view 
        onlyRegistered 
        returns (
            uint[] memory nextLevelPrices
            ){

        nextLevelPrices = new uint[](marketingPlans.length);
        for(uint8 i = 0; i< nextLevelPrices.length; i++){

            // Set a next level number of the current marketing plan
            uint nextLevel = 1;

            // Check the current marketing plan activation
            if (partners[msg.sender].level.length > i){

                // The marketing plan is active

                // Increase the next level number by the level of the current marketing plan
                nextLevel += partners[msg.sender].level[i].length;
            }

            // Get the current exchange rate
            (
                uint exchangeRate,
                uint80 newRoundID,
                uint8 decimals // The number of decimals in the current exchange rate
            )=getExchangeRate(roundID);

            // Return a price of a level ups to the current level number of the current marketing plan 
            nextLevelPrices[i] = nextLevelPrice(getRequiredLevels(msg.sender, i, nextLevel), exchangeRate, decimals);

        }
    } 

    // Get account data
    function getMyData() 
        public 
        view 
        onlyRegistered 
        returns (
            uint id, 
            uint[] memory level,
            uint[] memory level1,
            uint[] memory level2,
            uint registrationDate,
            uint blockNumber, 
            address[] memory referals, 
            uint network
            ) {

        id = partners[msg.sender].id;
        level = partners[msg.sender].level[0];
        if (partners[msg.sender].level.length>1) {
            level1 = partners[msg.sender].level[1];
            if (partners[msg.sender].level.length>2)
            {
                level2 = partners[msg.sender].level[2];
            }
        }
                        
        registrationDate = partners[msg.sender].registrationDate;
        referals = partners[msg.sender].referals;
        network = getNetworkCount(msg.sender);
        blockNumber = partners[msg.sender].registrationBlockNumber;
    }

    // Get the current Top Leader status
    function getTopLeaderData() 
        public 
        view 
        returns (
            address topLeader,
            uint balance,
            uint bonusSumm,
            uint result,
            uint delta,
            uint mp,
            uint minimumLevel
            ) {

        // Return an address of the Top Leader
        topLeader = topLeaderAddress;

        // Return Top Leader collected summ
        balance = topLeaderBonusCollectedSumm;

        // Return summ of the Top Leader bonus
        bonusSumm = topLeaderBonusSumm;

        // Return result of the Top Leader
        result = topLeaderResult;

        // Return delta between results of the Top Leader and a message sender
        delta = getSuitableReferalsNumber (msg.sender);

        // Return number of the reuired activated marketing plan
        mp = marketingPlans.length-1;

        // Return minimum required marketing plan level 
        minimumLevel = topLeaderMinimumLevel;
    }

    // Registration under special conditions
    function marketingReg(address partnerAddress, uint level) public onlyOwner {

        // New Partner creation
        createNewPartner(partnerAddress, owner);

        // New Partner levels up
        // Loop marketing plans
        for (uint8 i = 0; i < marketingPlans.length; i++){

            // Activate current marketing plan
            partners[partnerAddress].level.push([1]);

            // Loop required levels count
            for (uint8 k = 0; k < level-1; k++){

                // Level up Partner's current marketing plan
                partners[partnerAddress].level[i].push(1);
                
                // Call the level up event
                emit levelUp (
                partnerAddress, 
                partners[partnerAddress].level[i].length,
                i
                );                  
            }

            // Call the reistration event 
            emit registration (
                partners[partnerAddress].id, 
                partnerAddress, 
                owner,
                i
                );
        }

        // Update Top Leader information if necessary 
        topLeaderCheck(owner);
    }

    // Get a required number of level ups of each marketing plan to 
    // level up current marketin plan to requested level
    function getRequiredLevels (address partnerAddress, uint mp, uint level) 
        private 
        view 
        returns (uint[] memory requiredLevels) {

        // Initiate a required levels array with length equals to the marketing plans count 
        requiredLevels = new uint[](mp+1);

        // Loop marketing plans of the Partner
        for (uint8 i = 0; i < mp + 1 ; i++){

            // Check for the marketing plan activation
            if (i < partners[partnerAddress].level.length){

                // The Marketiong plan is active

                // Check for the level of the current marketing plan
                if (partners[partnerAddress].level[i].length >= level){

                    // The level if equal or higher then required

                    // Zero level ups of the current marketing plan is required
                    requiredLevels[i] = 0;

                } else {

                    // The level of the current marketing plan is less then required

                    // Return difference between curent and requested levels of 
                    // the current marketing plan 
                    requiredLevels[i] = level - partners[partnerAddress].level[i].length;
                }
            } else {

                // The marketing plan is not active

                // Required number of the level ups of the current marketing plan is equal to 
                // the required level    
                requiredLevels[i] = level;
            }

        }
    }

    // Get number of referals invited after current Top Leader counting started
    function getSuitableReferalsNumber (address partnerAddress) private  view returns (uint count) {

        // Counter for a number of suitable referals 
        count = 0;

        // Loop referals of the partner registered after the start date of current Top Leader counting 
        for (uint i = 0; i< partners[partnerAddress].referals.length; i++){

            if (partners[partners[partnerAddress].referals[i]].registrationDate > topLeaderStartDate){
            
                // Increment the counter
                count++;

            }

        }        
    }

    // Check and update curunt Top Leader
    function topLeaderCheck (address partnerAddress) private {

        // The last marketing plan activation check
        if (partners[partnerAddress].level.length == marketingPlans.length || partnerAddress == owner) {

            // Partner level check
            if (partners[partnerAddress].level[marketingPlans.length-1].length >= topLeaderMinimumLevel || partnerAddress == owner) {

                // Set a prtner's result to compare
                uint suitableRaferalsNumber = getSuitableReferalsNumber(partnerAddress);

               // Best result check
                if (suitableRaferalsNumber> topLeaderResult){

                    // Update the Top Leader address
                    topLeaderAddress = partnerAddress;

                    // Update the Top Leader result
                    topLeaderResult = suitableRaferalsNumber;
                }
            }
        }    
    }

    // The levels up function
    function upPartnerLevels (address partnerAddress, uint[] memory requiredLevels, uint exchangeRate, uint8 decimals) private {

        // The current level of the current marketing plan can't be less
        // then a previos marketing plan level
        // A level up procedure always starts from a first marketing plan and
        // step by step go to current

        // Loop reured marketing plans
        for (uint8 i = 0; i < requiredLevels.length; i++) {

            // Loop required levels of the current marketing plan to up
            for(uint8 k = 0; k < requiredLevels[i]; k++) {

                // Current level up price
                uint price = 0;

                // Check for owner
                if (partnerAddress != owner){

                    // The partner is not the owner

                    // Set the current level up price
                    price = levelUpPrice(partnerAddress, i, exchangeRate, decimals);
                }
                

                // Level up the partner
                upPartnerLevel(partnerAddress, price, i);
            }
        }
    }
    
    // The level up execution procedure
    function upPartnerLevel (address partnerAddress, uint price, uint mp) private {

        // Check the current marketing plan activation        
        if (partners[partnerAddress].level.length > mp) {

            // The marketing plan is active

            // Add a next slot number to the a level of the current marketing plan
            partners[partnerAddress].level[mp].push(1);

        } else {

            // The marketing plan is not  active

            // Activate the current marketing plan and add a next slot number of a first level
            partners[partnerAddress].level.push([1]);

        }
        
        // Is it registration?
        if (partners[partnerAddress].level[mp].length>1 ) {
            
            // Call the level up event with the sponsor ID and the new partner's level
            emit levelUp (
                partnerAddress, 
                partners[partnerAddress].level[mp].length,
                mp
                );        
        } else {
            
            // Call the reistration event with a new partner's ID and 
            //the sponsor address
            emit registration (
                partners[partnerAddress].id, 
                partnerAddress, 
                partners[partnerAddress].sponsorAddress,
                mp
                );
        }

        // Chek for owner
        if (partnerAddress != owner){

            // The partner is not the owner

            // Buy a new marketing plan level slot in the matrix
            payToPrtners(
                partners[partnerAddress].sponsorAddress, 
                price, 
                partners[partnerAddress].level[mp].length,
                mp
                );


            // Check for level 6 of the last marketing plan
            if (mp == marketingPlans.length-1 && partners[partnerAddress].level[mp].length == 6) {

                // Check for a Top Leader conditions
                topLeaderCheck(partnerAddress);
            }
        }
    }

    // The level up price calculation fauction
    function levelUpPrice(address partnerAddress, uint mp, uint exchangeRate, uint8 decimals) private view returns(uint price) {


        // Return the registration price of the desired marketing plan, 
        // multiplied by two to the power equal to the current level

        uint level = 0;

        if (partners[partnerAddress].level.length > mp) {

            level = partners[partnerAddress].level[mp].length;
        }

        price = getRegistrationPrice(mp, exchangeRate, decimals)*2**level;
    }
    
    // The payments execution function
    function payToPrtners (address sponsorAddress, uint amount, uint level, uint mp) private {
        

        // Calculate summ of a Top Leader bonus fee
        uint toTopLeaderBonus = amount*topLeaderBonusFee/100;

        // Take the Top Leader bonus fee
        uint leftToPay = amount-toTopLeaderBonus;

        // Calculate summ to pay out for the slot
         uint summToPay = directBonus*amount/100; 

        // Looking the first eligible sponsor to sell the slot on the level 
        // of the required marketing plan
        // It can be only the first same-level sponsor with a free slot 
        // in a pool or the higer-level sponsor
        address currentPartnerAddressToPay = findPartnerToPay(sponsorAddress, level, summToPay, mp); 
                      
        // Check should we look at the structure or this is a owner's referal
        if (currentPartnerAddressToPay == owner) {

            // Up owner's level if necessary
            if (partners[owner].level[mp].length < level) {

                uint[] memory requiredLevels = getRequiredLevels(owner, mp, level);

                upPartnerLevels(owner, requiredLevels, 1, 0);

            }
        }
            
        // Incriment a next slot number at the level
        saveLevelIncrement(currentPartnerAddressToPay, level, mp);

        // Pay for the slot to an eligible sponsor
        payToPartner(currentPartnerAddressToPay, 1, summToPay, level, mp); 

           
        // Set a next partner to pay out leader's bonuses
        currentPartnerAddressToPay = partners[sponsorAddress].sponsorAddress; 
            
        // Reduce the amount to be paid by the amount of the payment already made 
        leftToPay -= summToPay;
            
        // Paying network bonuses to leaders 

        // Loop a higest marketing plan leaders bounuses 
        for (uint8 i = 0; i < marketingPlans[marketingPlans.length-1].leaderBonusLevels.length; i++) {
                
            // Check if the next sponsor is the owner
            if (currentPartnerAddressToPay == owner) {
                    
                // Pay to the owner
                payToPartner(owner, i + 2, leftToPay, level, mp);

                leftToPay = 0;

                break; // Stop the payment procedure
            }

            // A summ of the network bonus to pay to the current partner
            uint currentSummToPay = 0;
          
            for (uint8 k = 1; k < marketingPlans.length; k++){

                if (i < marketingPlans[k].leaderBonusLevels.length){

                    // Calculate summ of a bonus to pay out
                    summToPay = marketingPlans[k].leaderBonusLevels[i]*amount/100;

                    // Rounding error protection
                    // Checking the amount of the last bonus
                    if (i == marketingPlans[marketingPlans.length-1].leaderBonusLevels.length-1 && summToPay > leftToPay) {

                       // Summ to pay is more than left amount or equal to it

                        // Set summ to pay as left to pay amount
                        summToPay = leftToPay;

                        // Reset left to pay amount to 0
                        leftToPay = 0;

                    } else {

                        // Reduce left to pay summ
                        leftToPay -= summToPay;
                    }                 
                    
                    // Check partners level
                    if (partners[currentPartnerAddressToPay].level.length - 1 >= k) {

                        // The partner has nessesary level to receive payment

                        // Increase current summ to pay
                        currentSummToPay += summToPay;
                       
                    } else {

                        // The partner hasn't nessesary level to receive payment

                        // Emit missing bonus event
                        emit missingBounus (currentPartnerAddressToPay, i + 2, level, summToPay, mp, k);

                        // Increase Top Leader Bonus summ to collect
                        toTopLeaderBonus +=summToPay;
                    }

                }
                
            }

            // Check the current summ to pay
            if (currentSummToPay > 0) {

                // There are bonuses for payout

                // Pay to the partner
                payToPartner(currentPartnerAddressToPay, i + 2, currentSummToPay, level, mp);
            }
     
            // Set a next partner to pay out 
            currentPartnerAddressToPay = partners[currentPartnerAddressToPay].sponsorAddress; 
        }
        
        // Increase Top Leader Bonus collected summ 
        topLeaderBonusCollectedSumm += toTopLeaderBonus;
     
    }


    // The payment function
    function payToPartner (address partnerAddress, uint bonusType, uint amount, uint level, uint mp) private {
        
        
        // Pay out bonus
        payable(partnerAddress).transfer(amount); 
        
        // Call a bonus pais out event with addres and paid summToPay
        emit bonusPaidOut(partnerAddress, bonusType, amount, level, mp);        
    }
    
    // Search for the partner who has fulfilled the conditions for receiving payment
    function findPartnerToPay (
            address partnerAddress, 
            uint level,
            uint amount, 
            uint mp
        ) 
        private 
        returns (address) {
       
        // Check if it is an owner's address
        if ( partnerAddress == owner) {
            
            return owner; // Return the owner's address as an address to pay 
        }
        
        // Check conditionals for pay to the partner:
        // The partner's level should be same or higher then level of payment
        // The partner with higher level has unlimited slots 
        // The partner with the same level should have a free slot
        // The partner's next free slot shouldn't be a last in the pool
        // If any of the conditions is not met, then the payment is redirected to the sponsor. 
        // The sponsor must also pass a broach eligibility check.
        
        // Set partner's sponsor
        address sponsorAddress = partners[partnerAddress].sponsorAddress;


        // Check for required marketing palan ativation
        if (partners[partnerAddress].level.length > mp) {

            // The required marketing plan is active
        
            // Set current partner's level
            uint partnersLevel = partners[partnerAddress].level[mp].length; 
            
            // Check that the partner's level is higher than required
            if (partnersLevel > level) {

                // The level high enougth
                
                // Check if the partner shouldn't pay for reopen of the pool
                if (!isReopen(partnerAddress, level, mp)) {
                    
                    // Return the partner's address as address to pay
                    return partnerAddress; 

                } else { // The partner should pay for reopen of the pool to the sponsor
                
                    // Return a suitable sponsor to pay for the pool
                    return findPartnerToPay(sponsorAddress, level, amount, mp); 
                }
            } else { 

                // The partner's level not higer then payment level
                
                // Do the partner has a same level?
                if (partnersLevel == level) {
                    
                    //Check if it is a reopen of the pool
                    if (isReopen(partnerAddress, level, mp)) { 

                        // The partner pays for reopen of the pool
                            
                        // Search a sutable sponsor to pay for the reopen
                        return findPartnerToPay(sponsorAddress, level, amount, mp);

                    } else {

                        // Check if the partner's slots at the level isn't exhausted
                        if (partners[partnerAddress].level[mp][level-1] < slotsPerLevel) {
                            
                            // Return the partner's address as address to pay
                            return partnerAddress;  
                            
                        } else { 

                            // This partner haven't sutable slots
                           
                            // Call missing bounus event with the address of the partner 
                            // who missed the bonus and the bonus level 
                            emit missingBounus (partnerAddress, 1, level, amount, mp, 0);

                            // Continue a suitable sponsor search
                            return findPartnerToPay(sponsorAddress, level, amount, mp);
                            
                        }  
                    }              
                } else { // The partner's level lower then level of the payment
                    
                    // Call missing bounus event with the address of the partner 
                    // who missed the bonus and the bonus level 
                    emit missingBounus (partnerAddress, 1, level, amount, mp, 0);
                    
                    // Continue a suitable sponsor search 
                    return findPartnerToPay(sponsorAddress, level, amount, mp); 
                    
                }
            }
        } else { 

            // The partner do not have an activated required marketing plan 

            // Call missing bounus event with the address of the partner 
            // who missed the bonus and the bonus level 
            emit missingBounus (partnerAddress, 1, level, amount, mp, 0);
                    
            // Continue a suitable sponsor search 
            return findPartnerToPay(sponsorAddress, level, amount, mp); 

        }
    }
    
    // A pool reopen chek function 
    function isReopen (address partnerAddress, uint level, uint mp) private returns(bool reopen) {
        
        // Check current pool length less than maximum slots per pool number
        if ((partners[partnerAddress].level[mp][level-1]-1) % slotsPerPool+1 == slotsPerPool){
            
            // Incriment a next slot number at the level
            saveLevelIncrement(partnerAddress, level, mp);
            
            // Call the poll reopened event with the partner address and the pool level
            emit poolIsReopened(partnerAddress, level, mp);
            
            reopen = true;
        }
    }
    
    
    // IntOveflow protection 
    function saveLevelIncrement (address partnerAddress, uint level, uint mp) private {
        
        // The maximum uint value check                
        if (partners[partnerAddress].level[mp][level-1] <type(uint).max) 
        {
            // Incriment the level next slot value
            partners[partnerAddress].level[mp][level-1] ++; 
        } 
        else 
        {
            // Reset the level next slot to the slots per level value 
            //to prevent new free slots emergence
            partners[partnerAddress].level[mp][level-1] = slotsPerLevel+1;
        }
    }

    // New Partner data creation
    function createNewPartner (address partnerAddress, address sponsorAddress) private {
        
        // Generate new ID
        uint newID = shortIdForLinks.length + prefID;
        
        // Mapping ID to addres
        shortIdForLinks.push (partnerAddress);
        /*
        // Create a new partner
        Partner memory p;
        partners[partnerAddress] = p;
        */
        // Set the partner's ID
        partners[partnerAddress].id = newID;
        
        // Set sponsor to the new partner
        partners[partnerAddress].sponsorAddress = sponsorAddress;

        // Set the registration date
        partners[partnerAddress].registrationDate = block.timestamp;

        // Set the registration block number
        partners[partnerAddress].registrationBlockNumber = block.number;

        // Add the new partner into the sponsor's list of referals
        partners[sponsorAddress].referals.push(partnerAddress);        
    }

    // Current registration price
    function getRegistrationPrice (uint mp, uint exchangeRate, uint8 decimals) private view returns (uint price) {

        // Return a registration price to the required marketing plan
        price = marketingPlans[mp].registrationPrice*10**(18+decimals)/exchangeRate;
    }

    // Calculate the next level price
    function nextLevelPrice (uint[] memory requiredLevels, uint exchangeRate, uint8 decimals) private view onlyRegistered returns  (uint price) {
        
        // Tthe price of the next level is twice the price of the current one.
        // The Level of the marketing plan have to be less or the same of previos plan's level.
        // The price of the next level of the current marketing plan is a summ of a level ups prices
        // of this and an all previos plans to the required level.

        // Start a price count form 0
        price = 0;

        if (msg.sender != owner) {

            uint currentLevel;

            // Go through all the marketing plans, the levels at which should be increased
            for (uint8 i = 0; i<requiredLevels.length; i++){

                // Set the current level 
                currentLevel = 0;

                // Check the current marketing plan activation
                if (partners[msg.sender].level.length>i) {

                    // The marketing plan is active

                    // Increase the current level by the partner's level of the current marketing plan
                    currentLevel = partners[msg.sender].level[i].length;
                }

                // Loop required levels of the current marketing plan
                for (uint8 k = 0; k < requiredLevels[i]; k++){

                    // Incriment the price by the price of the current marketing plan level
                    price += getRegistrationPrice(i, exchangeRate, decimals)*2**(currentLevel+k);
                }
            }
        }
    }

    function getAdress() public view returns(address contractAddress) {

        return address(this);
    }

    // Pay the Top Leader bonus
    function topLeaderBonusPay () private {

        // Pay to the partner
        payToPartner(topLeaderAddress, 0, topLeaderBonusSumm, 0, 0); 

         // Set default Top Leader
        topLeaderAddress = owner;

        // Check the Top Leader bonus collection duration
        if (block.timestamp - topLeaderStartDate <= 1 weeks) {

            // The Top Leader Bonus was collected less then a week

            // Twice the Top Leader bonus amount
            topLeaderBonusSumm *=2;

        } else if (block.timestamp - topLeaderStartDate >= 4 weeks) {

            // The Top Leader Bonus was collected more then 4 weeks

            // Half the Top Leader bonus amount
            topLeaderBonusSumm /=2;
        }

        // Set a new Top Leader collection start date
        topLeaderStartDate = block.timestamp;

        // Start over counter
        topLeaderResult = 0;   

        // Restart bonus collection
        topLeaderBonusCollectedSumm = 0;     
    }    

